// components/Sidebar.js
import React from 'react';
import { NavLink } from 'react-router-dom';

const Sidebar = () => {
  return (
    <aside className="h-full p-4 bg-gray-100">
      <ul>
        <li className="mb-2">
          <NavLink to="/" className="block p-2 hover:bg-gray-200 rounded">
            Dashboard
          </NavLink>
        </li>
        <li className="mb-2">
          <NavLink to="/projects" className="block p-2 hover:bg-gray-200 rounded">
            Projects
          </NavLink>
        </li>
        <li className="mb-2">
          <NavLink to="/tasks" className="block p-2 hover:bg-gray-200 rounded">
            Tasks
          </NavLink>
        </li>
        {/* Additional navigation items as needed */}
      </ul>
    </aside>
  );
};

export default Sidebar;
